import React from 'react';

function ImagePopup() {
  return (
    <aside className={`popup ${props.selectedCard && 'popup_opened'}`}>
      <div className="popup__picture-container">
        <button id="fullSizePicturePopapCloseButton" 
          className="popup__close-button" 
          type="button" 
          onClick={props.onClose}>
        </button>
        <div>
          <img src={props.src} className="popup__picture" alt={props.name}/>
          <p className="popup__picture-name">{props.name}</p>
        </div>
      </div>
    </aside>
  );
}

export default ImagePopup;
